        "from PIL import Image\n",
        "from io import BytesIO\n",
        "import numpy as np\n",
        "import matplotlib.pyplot as plt\n",
        "import matplotlib\n",
        "import tensorflow as tf\n",
        "import matplotlib.pyplot as plt\n",
        "import seaborn as sns\n",
        "import networkx as nx\n",
        "from sklearn.manifold import MDS\n",
        "\n",
        "def fig2img(fig):\n",
        "    buf = BytesIO()\n",
        "    fig.savefig(buf, format='png')\n",
        "    buf.seek(0)\n",
        "    img = Image.open(buf)\n",
        "    return np.array(img)\n",
        "\n",
        "\n",
        "# 위에서 계산한 코사인 유사도 행렬을 사용\n",
        "cos_sim_matrix = np.array([[1., 0., 0., 0.01293174],\n",
        "                           [0., 1., 0.10509751, 0.11051734],\n",
        "                           [0., 0.10509751, 1., 0.07138745],\n",
        "                           [0.01293174, 0.11051734, 0.07138745, 1.]])\n",
        "\n",
        "# 코사인 유사도 행렬을 이미지로 변환\n",
        "fig, ax = plt.subplots()\n",
        "cax = ax.matshow(cos_sim_matrix, cmap='Greys')\n",
        "\n",
        "fig.colorbar(cax)\n",
        "\n",
        "# 이미지를 저장하고 텐서보드에 로그\n",
        "log_dir = \"logs/cosine_similarity\"\n",
        "writer = tf.summary.create_file_writer(log_dir)\n",
        "\n",
        "with writer.as_default():\n",
        "    # Convert the figure to an image tensor\n",
        "    image_tensor = tf.convert_to_tensor(fig2img(fig)[None, ...])\n",
        "    tf.summary.image(\"Cosine Similarity Matrix\", image_tensor, step=0)\n",
        "\n",
        "class ax0:\n",
        "    @staticmethod\n",
        "    def plot():\n",
        "        ax = sns.heatmap(cos_sim_matrix, annot=True, fmt=\".2f\", cmap=\"YlGnBu\")\n",
        "        plt.title('Heatmap of Cosine Similarity Matrix')\n",
        "        plt.show()\n",
        "\n",
        "class ax1:\n",
        "    @staticmethod\n",
        "    def plot():\n",
        "        G = nx.Graph()\n",
        "\n",
        "        for i in range(len(cos_sim_matrix)):\n",
        "            for j in range(len(cos_sim_matrix)):\n",
        "                if i != j and cos_sim_matrix[i][j] > 0:\n",
        "                    G.add_edge(i, j, weight=cos_sim_matrix[i][j])\n",
        "\n",
        "        pos = nx.spring_layout(G)  # positions for all nodes\n",
        "\n",
        "        nx.draw_networkx_nodes(G, pos, node_size=500)\n",
        "        nx.draw_networkx_edges(G, pos, width=1.0, alpha=0.5)\n",
        "        nx.draw_networkx_labels(G, pos, font_size=12)\n",
        "\n",
        "        plt.title('Network Graph of Cosine Similarity')\n",
        "        plt.show()\n",
        "\n",
        "class ax2:\n",
        "    @staticmethod\n",
        "    def plot():\n",
        "        embedding = MDS(n_components=2)\n",
        "        mds_result = embedding.fit_transform(1 - cos_sim_matrix)  # 1 - cos_sim_matrix to convert similarity to distance\n",
        "\n",
        "        plt.scatter(mds_result[:, 0], mds_result[:, 1])\n",
        "        for i, txt in enumerate([\"Linear Algebra\", \"Differential Calculus\", \"Integral Calculus\", \"Differential Equations\"]):\n",
        "            plt.annotate(txt, (mds_result[i, 0], mds_result[i, 1]))\n",
        "\n",
        "        plt.title('MDS of Cosine Similarity Matrix')\n",
        "        plt.show()\n",
        "\n",
        "for ax_class in [ax0, ax1, ax2]:\n",
        "    ax_class.plot()\n",
        "\n",
        "\n",
        "# TensorBoard를 실행하여 시각화 확인\n",
        "# 터미널에서 아래의 명령을 실행\n",
        "# tensorboard --logdir logs/cosine_similarity"
